(1427, 481, NULL, NULL, '<p><span>Рио Бисквиты для птиц с лесными ягодами</span><br /><span>Дополнительное питание для декоративных птиц. Бисквиты RIO - это вкусная и питательная добавка к основному рациону для всех видов птиц. Приготовленные из цельных яиц и злаков, бисквиты будут особенно полезны в период линьки и размножения.</span><br /><span>Состав: злаки, яйца и яичные продукты (30%), сахар (в том числе мед), сушеные ягоды (черника, ежевика, малина, земляника) - 1%, хлебопекарные продукты.</span></p>', NULL, NULL, NULL),
