(1514, 481, NULL, NULL, '<p><span>Описание: Классическая питательная формула помады не растекается и долго держится. Помада Luxvisage Lipstick-легко наносится, а ее кремовая текстура обволакивает губы, делая их кожу гладкой и нежной. Помада имеет в составе витамины С и Е, которые обеспечивают увлажнение и питание нежной кожи. Средство подчеркивает женственность и придает вашему образу соблазнительное очарование.</span></p>', NULL, NULL, NULL),
