(1660, 257, NULL, 'В нашем блоге мы публикуем обзоры самых последних новинок в мире бытовой электроники', NULL, NULL, NULL, NULL),
(1660, 7, NULL, 'бытовая техника', NULL, NULL, NULL, NULL),
