(1661, 3, NULL, 'Электроника 432-Д', NULL, NULL, NULL, NULL),
(1661, 4, NULL, NULL, '<p>Переносной телевизионный приёмник цветного изображения <a href=\"/obzory_novinok_tehniki/elektronika_432d/\">\"Электроника Ц-432/Д\"</a> по своим характеристикам может дать фору многим современным изделиям. Он способен принимать программы цветного и чёрно-белого телевидения на любом канале в метровом диапазоне волн, а данная модель (с индексом \"Д\") - в том числе на любом из каналов дециметрового диапазона. Экран, или как его называли раньше - кинескоп, имеет размер диагонали 25 см.</p>\r\n<p>Телевизор можно подключить к сети переменного тока с напряжением от 176 до 243 В (забудьте о дорогих стабилизаторах!) или от источника постоянного тока напряжением 11...14,5 В - например, прямо в вашем автомобиле.</p>', NULL, NULL, NULL),
(1661, 243, 1360819800, NULL, NULL, NULL, NULL, NULL),
(1662, 4, NULL, NULL, '<p>Это один из лучших обзоров, который мне доводилось читать. Пишите ещё!</p>', NULL, NULL, NULL),
