(1663, 4, NULL, NULL, '<p>Как отремонтировать технику в домашних условиях, не тратя время на вызов специалистов.</p>', NULL, NULL, NULL),
(1664, 2, NULL, 'С чего начать?', NULL, NULL, NULL, NULL),
