(1665, 301, NULL, NULL, 'Чтобы разобрать аппарат, вам потребуется отвёртка с длинным тонким жалом. В большинстве случаев все корпусные винты отмечены в документации на прибор, так что вы легко их найдёте.', NULL, NULL, NULL),
